import React, { useState, useEffect } from "react";
import "./Styles/App.scss";
import ContentBody from "./components/ContentBody.js";

export default function App() {
  // State
  const [topics, setTopics] = useState([
    // { id: 1, topicTitle: "learn stuff" },
    // { id: 2, topicTitle: "get a job" },
  ]);

  //Functions
  function getTopics() {
    try {
      fetch("http://localhost:8000/api/topics")
        .then(res => res.json())
        .then(res => {
          setTopics(res.Items);
        });
    } catch (err) {
      console.log("Did not fetch topics!!", err);
    }
  }

  return (
    <div className='App'>
      <ContentBody className='App-Body' />
    </div>
  );
}
